function executeSearch(c) {
    c.preventDefault();
    showLoading();
    var transform = {
        "terms": document.getElementById("searchIn").value.split(' ')
    }
    postJSON(transform, baseUrl + "/search", function (e) {
        if (e.success) {
            showResults(e.result);
        }
    })
}

function showLoading() {
    document.getElementById("loading-contain").style.display = "block";
}

function hideLoading() {
    document.getElementById("loading-contain").style.display = "none";
}

function geocodeLatLng(geocoder, map, infowindow, lat, lon) {

    var latlng = { lat: lat, lng: lon };
    geocoder.geocode({ 'location': latlng }, function (results, status) {
        if (status === 'OK') {
            if (results[0]) {
                // map.setZoom(11);
                var marker = new google.maps.Marker({
                    position: latlng,
                    map: map
                });
                address = results[0].formatted_address
                // infowindow.setContent(results[0].formatted_address);
                //infowindow.open(map, marker);
            } else {
                window.alert('No results found');
            }
        } else {
            window.alert('Geocoder failed due to: ' + status);
        }
    });
}

function addressSearch(map, lat, lon) {
    var geocoder = new google.maps.Geocoder;
    var infowindow = new google.maps.InfoWindow;
    geocodeLatLng(geocoder, map, infowindow, lat, lon);
}

function fileToByteArray(e) {
    var files = e.target.files;
    for (var f of files) {
        var reader = new FileReader();
        reader.onload = function () {
            var arrTmp = this.result,
                arr = new Uint8Array(arrTmp),
                arrRes = [];
            for (var i = 0; i < arr.length; i++) {
                arrRes.push(arr[i]);
            }
            fileBytes.push(arrRes);
        }
        reader.readAsArrayBuffer(f);
    }
};

function initMap() {
    lat = 40.6942036;
    lon = -73.9887677;
    if (navigator.geolocation) {
        navigator.geolocation.getCurrentPosition(function (e) {
            lat = e.coords.latitude;
            lon = e.coords.longitude;

            map = new google.maps.Map(document.getElementById('map'), {
                zoom: 14,
                center: new google.maps.LatLng(lat, lon),
                mapTypeId: 'roadmap'
            });
            getJSON(baseUrl + "/getEvents", function (e) {
                if (e.success) {
                    renderMarkers(e.result);
                    showResults(e.result);
                    addressSearch(map, lat, lon);
                }
            })
        }, function (e) {
            hideLoading();
            document.getElementById("needLocation").style.display = "block";
            map = new google.maps.Map(document.getElementById('map'), {
                zoom: 14,
                center: new google.maps.LatLng(lat, lon),
                mapTypeId: 'roadmap'
            });
            getJSON(baseUrl + "/getEvents", function (e) {
                if (e.success) {
                    renderMarkers(e.result);
                    showResults(e.result);
                    addressSearch(map, lat, lon);

                }
            })
        })
    }
    else {
        map = new google.maps.Map(document.getElementById('map'), {
            zoom: 14,
            center: new google.maps.LatLng(lat, lon),

            mapTypeId: 'roadmap'
        });
        hideLoading();
        getJSON(baseUrl + "/getEvents", function (e) {
            if (e.success) {
                renderMarkers(e.result);
                showResults(e.result);
                addressSearch(map, lat, lon);

            }
        })
    }
}

